     QScriptValue REcmaSharedPointerBox::copy
    (QScriptContext *context, QScriptEngine *engine)
    
    {
        RBox cp = qscriptvalue_cast<RBox>(context->thisObject());
        return qScriptValueFromValue(engine, cp);
    }
     QScriptValue REcmaSharedPointerBox::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        RBox* self = getSelf("RBox", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    RBox* REcmaSharedPointerBox::getSelf(const QString& fName, QScriptContext* context)
    
        {
            RBox* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<RBoxPointer >(context->thisObject())
                
                    ->data()
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RBox.%1(): "
                        "This object is not a RBox").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
        RBox* REcmaSharedPointerBox::getSelfShell(const QString& fName, QScriptContext* context)
    
        {
          RBox* selfBase = getSelf(fName, context);
                RBox* self = dynamic_cast<RBox*>(selfBase);
                //return REcmaHelper::scriptValueTo<RBox >(context->thisObject());
            if(self == NULL){
                REcmaHelper::throwError(QString("RBox.%1(): "
                    "This object is not a RBox").arg(fName),
                    context);
            }

            return self;
            


        }
